$.widget("unicaen.bootstrapDatetimepicker", {
    _create: function ()
    {
        var options = this.element.data('options');
        if (!options.locale){
            options.locale = 'fr';
        }
        if (!options.allowInputToggle){
            options.allowInputToggle = true;
        }
        this.element.datetimepicker(options);
    },
});

